INSERT INTO `tb_device_value_task` (`id`, `task_name`, `task_param`, `create_time`, `update_time`) VALUES
	(1, '范例：简单脚本', '{"cacheSize": 10, "dataSource": {"dataObject": {"objectName": ["系统输出功率", "逆变器06输出功率", "逆变器01输出功率", "逆变器03输出功率"], "objectType": "object"}, "deviceName": "", "deviceType": "CE+T UPS", "sourceType": "deviceType", "manufacturer": "深圳安圣电气有限公司"}, "description": "算法说明：对输入的一组数据，进行简单的计算处理\\n返回数值：\\n    var result = {\\n        \\"系统输出功率(+1)\\": value1 + 1,\\n        \\"逆变器06输出功率(x2)\\": value2*2,\\n        \\"逆变器01输出功率(+100)\\": value3 + 100,\\n        \\"逆变器03输出功率(/2)\\": value4/2,\\n    }", "methodScript": "/**\\n * 脚本函数\\n * 全局参数：\\n *     values：缓存中的数值对象列表\\n *            范例：[\\n *                    {\\"value\\":26.4,\\"time\\":1715952708573},\\n *\\t\\t\\t\\t\\t  {\\"value\\":26.4,\\"time\\":1715952708573}\\n *\\t\\t\\t\\t\\t]\\n *     params：设备的配置参数\\n * 返回值：\\n *     map结构的对象\\n *            范例：{\\n *                    \\"系统输出功率1(任务)\\":26.4,\\n *                    \\"系统输出功率2(任务)\\":26.5\\n*\\t\\t\\t\\t\\t}\\n */\\nfunction main() {\\n    var valueObjectList1 = values[\\"系统输出功率\\"];\\n    var valueObjectList2 = values[\\"逆变器06输出功率\\"];\\n    var valueObjectList3 = values[\\"逆变器01输出功率\\"];\\n    var valueObjectList4 = values[\\"逆变器03输出功率\\"];\\n\\n    // 获取数组末尾元素\'\\n    var valueObject1 = valueObjectList1[valueObjectList1.length - 1];\\n    var valueObject2 = valueObjectList2[valueObjectList2.length - 1];\\n    var valueObject3 = valueObjectList3[valueObjectList3.length - 1];\\n    var valueObject4 = valueObjectList4[valueObjectList4.length - 1];\\n\\n    var value1 = valueObject1.value;\\n    var value2 = valueObject2.value;\\n    var value3 = valueObject3.value;\\n    var value4 = valueObject4.value;\\n\\n    var time = valueObject1.time;\\n\\n    var result = {\\n        \\"系统输出功率(+1)\\": value1 + 1,\\n        \\"逆变器06输出功率(x2)\\": value2*2,\\n        \\"逆变器01输出功率(+100)\\": value3 + 100,\\n        \\"逆变器03输出功率(/2)\\": value4/2,\\n    }\\n\\n    return result;\\n}\\n\\n"}', 1659070403700, 1716211507990),
	(2, '范例：原始数据', '{"cacheSize": 1, "dataSource": {"dataObject": {"objectName": [], "objectType": "all"}, "deviceName": "", "deviceType": "", "sourceType": "global", "manufacturer": ""}, "description": "算法说明：将设备的全体采样值，直接复制一份到计算值这边\\n返回数值：\\n    var result = {\\n        \\"系统输出功率\\": 2.0,\\n        \\"逆变器06输出功率\\": 11.5,\\n        \\"逆变器01输出功率\\": 100,\\n        ....\\n        ..\\n       .\\n    }", "methodScript": "/**\\n * 脚本函数\\n * 全局参数：\\n *     values：缓存中的数值对象列表\\n *            范例：[\\n *                    {\\"value\\":26.4,\\"time\\":1715952708573},\\n *\\t\\t\\t\\t\\t  {\\"value\\":26.4,\\"time\\":1715952708573}\\n *\\t\\t\\t\\t\\t]\\n *     params：设备的配置参数\\n * 返回值：\\n *     map结构的对象\\n *            范例：{\\n *                    \\"系统输出功率1(任务)\\":26.4,\\n *                    \\"系统输出功率2(任务)\\":26.5\\n*\\t\\t\\t\\t\\t}\\n */\\nfunction main() {\\n    var result = {};\\n    for (var key in values) {\\n        var valueObjectList = values[key];\\n        if (valueObjectList == null || valueObjectList.length == 0) {\\n            continue;\\n        }\\n        var valueObject = valueObjectList[valueObjectList.length - 1];\\n        result[key] = valueObject.value;\\n    }\\n    return result;\\n}"}', 1716208442048, 1716255918949);
